import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <ul>
         <li>Mangos</li>
         <li>Tomatos</li>
         <li>onions</li>
       </ul>
      </header>
    </div>
  );
}

export default App;
